import React, { Component } from 'react';
import '../App.css';


class CycleB extends Component {
    render() {
        let load = Math.min(this.props.weight-this.props.bar,0);
        let toggle = {display: this.props.isToggle? 'block' : 'none'}

        return (
            <ul className='Cycle'>
                <div className='container'
                     style={toggle}>
                    <div>40% Warmup Set 1 x 5x : {Math.round(load*4/10).toFixed(1)}kg</div>
                    <div>50% Warmup Set 2 x 5x : {Math.round(load*5/10).toFixed(1)}kg</div>
                    <div>60% Warmup Set 3 x 3x : {Math.round(load*6/10).toFixed(1)}kg</div>
                </div>
                <div>70% Working Set 1 3x {Math.round(load*70/100).toFixed(1)}kg</div>
                <div>80% Working Set 2 3x {Math.round(load*80/100).toFixed(1)}kg</div>
                <div>90% Working Set 3 3x+ {Math.round(load*90/100).toFixed(1)}kg</div>
            </ul>
            )
    }
}

export default CycleB;
